script: |
  super -f tsv -I q7595.sql | sort > q7595.out

vector: true

inputs:
  - name: q7595.sql
    data: |
      pragma pg
      SELECT DISTINCT + 34 AS col1 FROM tab2 GROUP BY col2, col1 HAVING + NULLIF ( + + ( - 21 ), + col1 ) + 90 < 56 * col2 * + col2;
  - name: tab2

outputs:
  - name: q7595.out
    data: |
      34
